	insert_print_queue: () => {
		var sql = "\nDECLARE @lastBarcode NVARCHAR(MAX)\n"
		sql += "SET @lastBarcode = (SELECT TOP 1 Barcode FROM OEM_Sample ORDER BY ID DESC)\n"
		sql += "INSERT INTO Bartender_Queue (Barcode, Created, Created_By, Template_Type, Status)\n"
		sql += "VALUES ( "
		sql += "@lastBarcode, "
		sql += "'" + moment().utc(0).format("YYYY-MM-DD HH:mm:ss") + "', "
		sql += "'" + appsmith.user.email + "', "
		sql += "'Barcode', "
		sql += "'New')"
		return sql
	},
	async filter_Legacy_APM(){
		await storeValue("FilterLegacy", true, false);
