	},
	store_print_sample: () => {
		var JSON_barcodes = appsmith.store.print_barcodes
		var print_barcodes = Object.values(JSON_barcodes).map(item => item.Barcode)
		for(let i=0;i<Tb_barcode_print.selectedRows.length;i++) {
			if (print_barcodes.indexOf(Tb_barcode_print.selectedRows[i].Barcode)===-1) {
				JSON_barcodes.push({'Barcode':Tb_barcode_print.selectedRows[i].Barcode})
			}
		}
		storeValue('print_barcodes', print_barcodes, false)
	},
	select_print_barcode: () => {
		var sql = "select *\n"
		sql += "from OEM_Sample\n"
		for(let i=0; i<Tb_barcode_print.selectedRows.length; i++) {
			if (i===0) {
				sql += "WHERE "
			}
			else {
				sql += "OR "
			}
			sql += "Barcode = '" + Tb_barcode_print.selectedRows[i].Barcode + "'\n"
		}
		sql += "ORDER BY ID DESC\n"
		return sql
	},
	insert_system_print_queue: () => {
		var select_barcode = Qry_select_Sample.data
		var sql = "INSERT INTO Bartender_Queue (Barcode, Created, Created_By, Template_Type, Status, ProjectID,	Country_of_Origin, DescriptionID,	Processor_Speed, Processor_Speed_Unit, Brand_Name, Storage_1, Storage_1_Unit,	Storage_2, Storage_2_Unit, Dimm_1, Dimm_1_Unit,	Dimm_2, Dimm_2_Unit, ODD, AC_DC_Adapter, Sample_Build, SKU,	Structure_Type,	Unit_Price_USD, Model_Name,	Part_Number, Remarks,	Serial_Number, Waybill,	Waybill_Provider,	Processor_SKU)\n"
		sql += "VALUES\n"
		for(let i=0; i<select_barcode.length; i++) {
			sql += "("
			sql += "'" + select_barcode[i].Barcode + "', "
			sql += "'" + moment().utc(0).format("YYYY-MM-DD HH:mm:ss") + "', "
			sql += "'" + appsmith.user.email + "', "
			sql += "'" + 'OEM System' + "', "
			sql += "'" + 'Ready for print' + "', "
			sql += "'" + (select_barcode[i].ProjectID === null ? '' : select_barcode[i].ProjectID) + "', "
			sql += "'" + (select_barcode[i].Country_of_Origin === null ? '' : select_barcode[i].Country_of_Origin) + "', "
			sql += "'" + (select_barcode[i].DescriptionID === null ? '' : select_barcode[i].DescriptionID) + "', "
			sql += "'" + (select_barcode[i].Processor_Speed === null ? '' : select_barcode[i].Processor_Speed) + "', "
